import item from "./item";
function items() {
    return (
        <div className="items">
            <item name="Air Conditioner" price="39000" url="https://source.unsplash.com/1600x1000/?airconditioner"/>
            <item name="Refrigerator" price="29000" url="https://source.unsplash.com/1600x1000/?refrigerator"/>
            <item name="LED TV" price="19000" url="https://source.unsplash.com/1600x1000/?ledtv"/>
        </div>
    )
}

export default items;
